I Lighthouse Family sono un duo inglese composto dal cantante Tunde Baiyewu e dal pianista Paul Tucker. Il loro debutto fu nel 1995 con l'album Ocean Drive che vendette 2,5 milioni di copie nel mondo. Ebbero successo anche in tutta Europa grazie all'album &quot;Postcards From Heaven&quot; con 3,7 milioni di copie vendute nel mondo. E il singolo High raggiunse i primi posti delle classifiche mondiali.

